import React from 'react';
import Link from 'next/link';

import { Wrapper } from './styled';

export const Header = () => {
  return (
    <Wrapper>
      <nav>
        <ul>
          <li>
            <Link href='/'>PerfAnalitics</Link>
          </li>
        </ul>
      </nav>
    </Wrapper>
  );
};
